import React from 'react'
import { useState, useEffect } from "react";

function Table(props) {

    const [node, setNode] = useState({ key: "", value: "" })



    const rows = props.data.map((item, index) => (

        <tr key={index} className='hover'>
            <th>{index + 1}</th>
            <td>{item.key}</td>
            <td>{item.value}</td>
            <td>
                <button className="btn btn-xs btn-active" onClick={setItemAndDisplayPopup} data-item={JSON.stringify(item)} popup-name="view">View</button>
                <button className="btn btn-xs btn-active" onClick={setItemAndDisplayPopup} data-item={JSON.stringify(item)} popup-name="edit">Delete</button>
            </td>

        </tr>

    ));

    return (
        <div><table class="table">
            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Key</th>
                    <th scope="col">Value</th>
                    <th scope="col">Edit</th>
                    <th scope="col">View</th>
                </tr>
            </thead>
            <tbody>
                {rows}
            </tbody>
        </table></div>
    )
}

export default Table
